import React, { Component } from "react";
import Link from "next/link";
import "../src/styles.css";

class Index extends Component {
  render() {
    return (
      <div>
        <h1>Index</h1>
        <Link href='/main'>
          <button className='btn'>Main</button>
        </Link>
      </div>
    );
  }
}

export default Index;
